app.post('/api/login', (req, res) => {
    const user = users.find(user => (user.email === req.body.email) && (user.password === req.body.password))
    if (user) {
        req.session.id = user.id
        res.status(200).send('successful logged')
    } else {
        res.status(404).send('user not found')
    }
})

app.get('/api/pizza/search/:searchString', (req, res) => {
    const searchString = new RegExp(`${req.params.searchString.toLowerCase().split(/[ -]/).join('.')}`)
    var results = []
    data.forEach(item => {
        if (item.name.toLowerCase().search(searchString) !== -1) {
            results.push(item)
        }
    })
    results = results.map(item => {
        return { ...item, avatar: `data:image/${item.type};base64, ${item.avatar}` }
    })
    res.status(200).send(results)
})

app.post('/api/add/user', (req, res) => {
    const data = {
        ...req.body,
        id: Math.round(Math.random() * 100000000),
        type: req.body.type ? req.body.avatar.slice(req.body.avatar.indexOf('/') + 1, req.body.avatar.indexOf(';')) : null,
        avatar: req.body.avatar ? req.body.avatar.slice(req.body.avatar.indexOf(',') + 1) : null
    }
    users.push(data)
    res.status(200).send('Registered')
})

