app.post('/api/add/user/update', (req, res) => {
    const data = {
        ...req.body,
        type: req.body.avatar.slice(req.body.avatar.indexOf('/') + 1, req.body.avatar.indexOf(';')),
        avatar: req.body.avatar.slice(req.body.avatar.indexOf(',') + 1)
    }
    const userIndex = users.indexOf(users.find(user => user.id === req.body.id))
    if (userIndex !== -1) {
        users[userIndex] = data
        res.status(200).send('Updated')
    } else {
        res.status(404).send('User not found')
    }
})

